          "description":"<ul style='margin: 0px; padding: 0px; list-style: outside none; color: rgb(77, 81, 86); font-family: Roboto, &quot;helvetica neue&quot;, helvetica, arial, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'><li class='va-top ov-h' style='margin: 0px 0px 4px; padding: 0px; vertical-align: top; overflow: hidden; zoom: 1; text-align: -webkit-match-parent;'><u><span style='font-size:18px;'><b style='font-weight: normal;'>Announcement</b></span></u><span>&nbsp;</span>is something that is written, printed, or spoken verbally so that other people know that there&rsquo;s something happening or about to happen. The following is the general structure of<span>&nbsp;</span><b style='font-weight: normal;'>announcement</b><span>&nbsp;</span>text: Title</li><li class='va-top ov-h' style='margin: 0px 0px 4px; padding: 0px; vertical-align: top; overflow: hidden; zoom: 1; text-align: -webkit-match-parent;'><p style='box-sizing: border-box; text-shadow: rgba(0, 0, 0, 0.024) 1px 1px 1px; -webkit-font-smoothing: antialiased !important; backface-visibility: hidden !important; margin: 0px 0px 15px; overflow-wrap: break-word; color: rgb(44, 62, 80); font-family: helvetica, arial, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'>The things you have to pay attention to when you want to make an oral announcement are clarity in the process of your delivery, intonation, pauses, and volume must be adjusted so that listeners can understand what you want to convey easily.</p><p style='box-sizing: border-box; text-shadow: rgba(0, 0, 0, 0.024) 1px 1px 1px; -webkit-font-smoothing: antialiased !important; backface-visibility: hidden !important; margin: 0px 0px 15px; overflow-wrap: break-word; color: rgb(44, 62, 80); font-family: helvetica, arial, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'>Here are some tips on how to make an announcement text:</p></li><li style='box-sizing: border-box; text-shadow: rgba(0, 0, 0, 0.024) 1px 1px 1px; -webkit-font-smoothing: antialiased !important; backface-visibility: hidden !important;'><strong>Announcement </strong>Text must be written concisely, clearly and easily understood.</li><li style='box-sizing: border-box; text-shadow: rgba(0, 0, 0, 0.024) 1px 1px 1px; -webkit-font-smoothing: antialiased !important; backface-visibility: hidden !important;'>Consider the main purpose of making an announcement, because it is not just a statement, but an announcement can also increase people&rsquo;s level of trust in what you are conveying, especially if you are about to announce a new product to potential buyers.</li><li style='box-sizing: border-box; text-shadow: rgba(0, 0, 0, 0.024) 1px 1px 1px; -webkit-font-smoothing: antialiased !important; backface-visibility: hidden !important;'>Give facts in the content of your announcement as needed and there is no need to overdo it so as not to change the purpose of the announcement.</li><li style='box-sizing: border-box; text-shadow: rgba(0, 0, 0, 0.024) 1px 1px 1px; -webkit-font-smoothing: antialiased !important; backface-visibility: hidden !important;'>Write announcements with short words and avoid repeating unnecessary words, because that will disturb those who listen&nbsp;or read the text of your announcement.</li><li style='box-sizing: border-box; text-shadow: rgba(0, 0, 0, 0.024) 1px 1px 1px; -webkit-font-smoothing: antialiased !important; backface-visibility: hidden !important;'>If you have finished writing the announcement text, don&rsquo;t forget to check it by proofreading to avoid misspellings, incorrect phrases, ineffective sentences, etc.</li><li style='box-sizing: border-box; text-shadow: rgba(0, 0, 0, 0.024) 1px 1px 1px; -webkit-font-smoothing: antialiased !important; backface-visibility: hidden !important;'>https://writerriver.com/announcement-text-definition-types-examples/&nbsp;</li></ul>"
